drop table if exists `airlines`;
create table airlines
(
    id                  bigint auto_increment
        primary key,
    iata_code           varchar(16)          null,
    icao_code           varchar(16)          null,
    accounting_code     varchar(16)          null,
    airline_prefix_code varchar(16)          null,
    chn_name            varchar(128)         null,
    eng_name            varchar(128)         null,
    call_sign           varchar(64)          null,
    city_code           varchar(16)          null,
    city_id             mediumint unsigned   null,
    country_code        varchar(16)          null,
    country_id          mediumint unsigned   null,
    description         longtext             null,
    is_delete           tinyint(1) default 0 not null,
    create_datetime     datetime(6)          not null,
    create_by           varchar(32)          not null,
    update_datetime     datetime(6)          not null,
    update_by           varchar(32)          not null,
    constraint airlines_cities__fk
        foreign key (city_id) references cities (id)
            on update cascade,
    constraint airlines_countries__fk
        foreign key (country_id) references countries (id)
            on update cascade
);

